def custom_decode(data, salt='ixl8WOswXC9Bcbqe', magic=7861):
    result = bytearray()
    for b, salt_char in zip(data, cycle(salt.encode())):
        result.append((b - salt_char - magic) % 256)
    return bytes(result)


